import React from 'react';

const products = [
  { brand: "Dior", name: "Sauvage", price: "Rp125.000 - Rp225.000", notes: "Calabrian bergamot, Pepper, Lavender, Pink Pepper, Vetiver, Patchouli, Geranium, Elemi, Ambroxan, Cedar, Labdanum" },
  { brand: "Whiskey", name: "Prestigious", price: "Rp70.000 - 110.000", notes: "Caramel, Vanilla, Honey, Oud Wood, Warm Spicy (Cinnamon, Nutmeg), Smokey Oak, Toffee, Malt" },
  { brand: "CK", name: "DEFY", price: "Rp75.000 - Rp130.000", notes: "Pink Pepper, Lavender, Cacao" },
  { brand: "Elvicto", name: "Escobar", price: "Rp27.000 - Rp55.000", notes: "Bergamot, Lemon, and Spicy-Cardamom, Lavender, Geranium, and Cinnamon, Amberwood, Patchouli, Tonka Bean, and Vanilla" },
  { brand: "Diesel", name: "Bad", price: "Rp85.000 - Rp135.000", notes: "Lavender, Bergamot, Cardamom, Violet Leaf, Caviar, Orris Root, Sage, Woody Notes, Tobacco, Ambroxan, Tonka Bean, Patchouli" },
  { brand: "YSL", name: "Y EDP", price: "Rp85.000 - Rp135.000", notes: "Apple, Ginger, Bergamot, Sage, Juniper Berries, Geranium, Amberwood, Tonka Bean, Cedar, Vetiver, Olibanum" },
  { brand: "Emporio Armani", name: "Stronger With You Intensely", price: "Rp80.000 - Rp135.000", notes: "Pink Pepper, Juniper, Violet, Toffee, Cinnamon, Lavender, Sage, Vanilla, Amber, Tonka Bean, Suede" },
  { brand: "Alien Goddess Supra", name: "Florale Mugler", price: "Rp95.000 - Rp150.000", notes: "Prickly Pear, Cactus Flower, Jasmine Sambac, Immortelle, Amber, Musk, Desert Rose" },
  { brand: "Jean Paul Gaultier", name: "Le Male Elixir", price: "Rp95.000 - Rp135.000", notes: "Lavender, Mint, Vanilla, Benzoin, Honey, Tonka Bean, Tobacco" },
  { brand: "Alien Mugler", name: "Original", price: "Rp90.000 - Rp140.000", notes: "Jasmine Sambac, Cashmeran, Amber" },
];

const Katalog = () => {
  return (
    <section className="bg-purple-50 px-6 py-10 min-h-screen">
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8 max-w-6xl mx-auto">
        {products.map((item, index) => (
          <div key={index} className="flex flex-col">
            <div className="bg-gray-100 rounded-3xl p-8 flex gap-6 items-center shadow-sm relative overflow-hidden">
              <div className="flex-1">
                <h3 className="text-3xl font-bold text-purple-600 mb-1">{item.brand}</h3>
                <h4 className="text-2xl font-bold text-orange-400 mb-4">{item.name}</h4>
                <div className="mb-4">
                    <p className="text-[11px] leading-tight text-gray-500">
                        <span className="font-bold text-orange-400">Top Notes:</span> {item.notes.split(',').slice(0,3).join(',')}
                    </p>
                    <p className="text-[11px] leading-tight text-gray-500">
                        <span className="font-bold text-orange-400">Middle Notes:</span> {item.notes.split(',').slice(3,6).join(',')}
                    </p>
                </div>
                <p className="text-sm font-extrabold text-gray-800">{item.price}</p>
              </div>
              <div className="w-24 h-36 bg-gray-300 rounded-lg flex items-center justify-center italic text-gray-400 text-xs">Bottle</div>
            </div>
            <button className="bg-orange-400 text-white font-bold py-3 rounded-full mt-3 hover:bg-orange-500 transition shadow-md">
              Beli
            </button>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Katalog;
